    cleaned_command = command.script_parts.copy()
    try:
        upstream_option_index = cleaned_command.index('--set-upstream')
    except ValueError:
        upstream_option_index = -1
    if upstream_option_index != -1:
        cleaned_command.pop(upstream_option_index)
